import React from 'react';
const Sresult=(props)=>{
    const img=`https://source.unsplash.com/400x300/?{props.text}`;
    return(
        <>
            <div className="img_filter">
                <img src={img} alt='img'/>
            </div>
        </>
    );
};
export default Sresult;
